export const Status = (queue) => {
    console.log("GroupSeqNo", queue)
    if (queue == "tobesitted") {
        return (
            "ממתין לשולחן"
        )
    }
    if (queue == "sitting") {
        return (
            "ממתין לשירות"
        )
    }
    if (queue == "awaitingbill") {
        return (
            "ממתין לחשבון"
        )
    }
}

export const responsServerFun = (responsServer) => {
    console.log("aaaaaaaa", responsServer)
    console.log("0", responsServer[0])
    console.log("1", responsServer[1])
    console.log("2", responsServer[2])
    if (responsServer == "No place to sit for any group") {
        return (
            " לא נמצא שולחן פנוי"
        )
    }
    else {
        return (
            <>
            <div>
                `נמצא שולחן id: ${responsServer[0]}`
            </div>
            <div>
                `לקבוצה: ${responsServer[1]}` 
            </div>
            <div>
                `שהגיעה בשעה: ${responsServer[2]}`   
            </div>
            </>
        )
    }
}
